import logo from './logo.svg';
import './App.css';
import Mood from 'react-background-slideshow'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p></p>
        <a> Mood </a>
      </header>
    </div>
  );
}

export default App;
